	<div
		class="max-w-screen-xl px-8 md:px-12 lg:px-16 xl:px-32 py-16 mx-auto bg-gray-100 text-gray-900 rounded-lg shadow-lg"
	>
		<div class="flex flex-col">
			<div>
				<h2 class="text-4xl lg:text-5xl font-bold leading-tight">Lets talk about everything!</h2>
				<div class="text-gray-700 mt-8">
					Hate forms? Send us an <a
						href="mailto:contact@gugutpodcast.com"
						class="underline text-secondary-500">email</a
					>
					instead.
				</div>
			</div>
			<div class="mt-8"></div>
		</div>
		<div class="">
			<div>
				<span class="text-sm text-gray-600 font-bold">Full Name</span>
				<input
					class="w-full bg-gray-200 text-gray-900 mt-2 p-3 rounded-lg focus:outline-none focus:shadow-outline"
					type="text"
					name="name"
					placeholder=""
					value=""
				/>
			</div>
			<div class="mt-8">
				<span class="text-sm text-gray-600 font-bold">Email / Phone</span>
				<input
					class="w-full bg-gray-200 text-gray-900 mt-2 p-3 rounded-lg focus:outline-none focus:shadow-outline"
					type="text"
					name="emailOrPhone"
					value=""
				/>
			</div>
			<div class="mt-8">
				<span class="text-sm text-gray-600 font-bold">Messaging About</span>
				<select
					name="message_type"
					class="w-full bg-gray-200 text-gray-900 mt-2 p-3 rounded-lg focus:outline-none focus:shadow-outline"
					><option value="general">General</option><option value="topic">Topic Suggestion</option
					><option value="guest suggestion">Guest Suggestion</option><option value="feedback"
						>Feedback</option
					><option value="internship">Internship</option><option value="other">Other</option
					></select
				>
			</div>
			<div class="mt-8">
				<span class="text-sm text-gray-600 font-bold">Message</span>
				<textarea
					name="message"
					class="w-full h-32 bg-gray-200 text-gray-900 mt-2 p-3 rounded-lg focus:outline-none focus:shadow-outline"
				></textarea>
			</div>
			<div class="mt-8">
				<button
					type="submit"
					class="uppercase text-sm font-bold tracking-wide text-gray-100 p-3 rounded-lg w-full focus:outline-none focus:shadow-outline bg-primary-500 hover:bg-primary-600"
					>Send Message</button
				>
			</div>
		</div>
	</div>
</form>
